def sumpfac(n):
    assert n % 2 != 0
    sum = 0
    cont = True
    while cont:
        cont = False
        for i in range(3, int(math.sqrt(n)) + 1, 2):
            if n % i == 0:
                n //= i
                sum += 1
                cont = True
                break
    if n > 1:
        sum += 1
    return sum

