def getPrimeFactors(n):
    nums = [0] * ceil(sqrt(n))
    nums[0] = 1
    nums[1] = 1
    for i in range(2, ceil(sqrt(sqrt(n)))):
        if not nums[i]:
            for j in range(i * i, ceil(sqrt(n)), i):
                nums[j] = 1
    return [i for (i, x) in enumerate(nums) if not x]
