def numOddPowers(n):
    while n % 2 == 0:
        n /= 2
    if n in factors:
        return 1
    else:
        count = 0
        for p in factors:
            if n < p:
                break
            if n % p == 0:
                while n % p == 0:
                    n /= p
                    count += 1
        if isPrime(n):
            count += 1
    return count
