def game(n, turn):
    if n == 2:
        return turn
    if n == 1:
        return not turn
    if n % 2 == 1:
        return turn
    else:
        k = n
        while k % 2 == 0:
            k = k // 2
        if k == 1:
            return not turn
        if prime(k):
            if n // k == 2:
                return not turn
            else:
                return turn
        else:
            return turn
